Defendant Khyntarian K Williams in court, in custody, with attorney Kevin Michael Gaertner.    Ted Szczupakiewicz appeared for the State of Wisconsin.    Defendant enters a plea of no contest to Counts 1 and 3,  Court finds defendant guilty.  Count 2 is dismissed and read in.

COUNT 1

The Court Orders the Following:

Imposed and Stayed Sentence of:

 9 months (First 3 months straight time remaining HUBER WITH STANDARD RELEASE CONDITIONS.) Credit - 142 days

Term of Probation:  2 Years

Conditions of Probation:
- AODA Assessment and follow through with any treatment recommended;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Maintain/Obtain full time activity;
- No contact with victim, A.N.N. and females under the age of 18.  Agent to reevaluate if the defendant enrolls in school.  
- Agent to evaluate for sex offender treatment and if appropriate to follow through with the recommendations;

Costs: $ 243.00
DNA Surcharge:  $200.00


COUNT 3

The Court Orders the Following:

Imposed and Stayed Sentence of:

3 months HUBER WITH STANDARD RELEASE CONDITIONS.  CONSECUTIVE TO COUNT 1

Term of Probation: 2 Years  CONCURRENT TO COUNT 1

Conditions of Probation:  SAME AS COUNT 1

Costs: $243.00 
DNA Surcharge:  $200.00

COSTS AND SURCHARGES: To be paid as a condition of probation.
